return (Math.round(dis * 1000)) / 1000
}

function direction(y1, x1, y2, x2) {//ポイントから見た移動体方角
    z = x2-x1
    z *=  Math.PI / 180;
    y1 *= Math.PI / 180;
    x1 *= Math.PI / 180;
    y2 *= Math.PI / 180;
    x2 *= Math.PI / 180;
    //x1 = Math.toRadians(x1);
   // x2 = Math.toRadians(x2);
   // y1 = Math.toRadians(y1);
   // y2 = Math.toRadians(y2);
    a=Math.sin(z);
    b=Math.cos(y1)*Math.tan(y2);
    c=Math.sin(y1)*Math.cos(z);
    //deg = Math.toDegrees(Math.atan2(a,b-c));
    //angle = (deg + 360) % 360;
