function TIME(time){
date = new Date(time);
var hh = ("0"+date.getHours()).slice(-2);
var mm = ("0"+date.getMinutes()).slice(-2);
var ss = ("0"+date.getSeconds()).slice(-2);
var mmm =("00"+date.getMilliseconds()).slice(-3);

return hh+":"+mm+":"+ss+":"+mmm;
}

function degToRad(degrees) {
  return degrees * (Math.PI / 180);
}

