function distance(lat1, lng1, lat2, lng2 ) {//２点間距離

         lat1 *= Math.PI / 180;
         lng1 *= Math.PI / 180;
         lat2 *= Math.PI / 180;
         lng2 *= Math.PI / 180;
         dis = 1000*6371 * Math.acos(Math.cos(lat1) * Math.cos(lat2) * Math.cos(lng2 - lng1) + Math.sin(lat1) * Math.sin(lat2))
         return (Math.round(dis * 100)) / 100;


}

function direction(y1, x1, y2, x2) {//２点間角度
    z = x2-x1
    z *=  Math.PI / 180;
    y1 *= Math.PI / 180;
    x1 *= Math.PI / 180;
    y2 *= Math.PI / 180;
    x2 *= Math.PI / 180;

    a=Math.sin(z);
    b=Math.cos(y1)*Math.tan(y2);
    c=Math.sin(y1)*Math.cos(z);

    dir=Math.atan2(a,b-c)*180/Math.PI;

    if(dir<0){
        dir=dir+360;
    }
return (Math.floor(dir*100)) / 100;
}

function redirection(y1, x1, y2, x2, bearing) {//進行方向との角度
    z = x2-x1
    z *=  Math.PI / 180;
    y1 *= Math.PI / 180;
    x1 *= Math.PI / 180;
    y2 *= Math.PI /180;
    x2 *= Math.PI / 180;

    a=Math.sin(z);
    b=Math.cos(y1)*Math.tan(y2);
    c=Math.sin(y1)*Math.cos(z);

    dir=Math.atan2(a,b-c)*180/Math.PI;

    if(dir<0){
        dir=dir+360;
    }
    re_dir=dir-bearing;
    if(re_dir<0){
        re_dir=re_dir+360;
    }
return (Math.floor(re_dir*100)) / 100;
}


